package algo.dp;

//https://leetcode.com/problems/jump-game-vii/
public class JumpGameVII {
    public static void main(String[] args) {
        System.out.println(canReach("011010", 2, 3));
        System.out.println(canReach("01101110", 2, 3));
       // System.out.println(canReach(""
          //              ,
            //    1, 49999));
    }

    public static boolean canReach(String s, int minJump, int maxJump) {
        char[] chars = s.toCharArray();

        if (chars[chars.length - 1] == '1') {
            return false;
        }

        Boolean[] dp = new Boolean[chars.length - 1];
        // dp[dp.length-1]=true;
        canReach(chars, minJump, maxJump, 0, dp);
        return dp[dp.length - 1]!=null?dp[dp.length-1]:false;
//        int[] dp=new int[chars.length];
//        dp[dp.length-1]=dp.length-1;
//
//        for(int i=chars.length-2;i>=0;i--){
//            if(chars[i]=='0'){
//                int minIndex=i+minJump;
//                int maxIndex=i+maxJump;
//
//            }
//
//        }
    }

    static boolean canReach(char[] chars, int minJump, int maxJump, int i, Boolean[] dp) {

        if (i == chars.length - 1 || (i+minJump<=chars.length-1 && i+maxJump>=chars.length-1)) {
            dp[dp.length-1]=true;
            return true;
        }
        if (dp[i] != null) {
            return dp[i];
        }
        boolean canReachNext = false;
        for (int j = Integer.min(i + maxJump,chars.length-1); j >= i + minJump; j--) {
            if(j<=chars.length-1) {


                canReachNext = canReachNext || (chars[j] == '0' && canReach(chars, minJump, maxJump, j, dp));

            }
            if (canReachNext) {
                break;
            }
        }
        dp[i] = canReachNext;
        return dp[i];
    }
}
